      name="R1"
      resistance="22"
      footprint="0402"
      pcbX={-7}
      pcbY={2}
      connections={{
        pin1: sel.J1.pin3,
        pin2: sel.U1.pin29,
      }}
    />
    <resistor
      name="R2"
      resistance="22"
